  return (
    <Fragment>
      <h1>calendar</h1>
      <table align="center" id="calendar_table"> 
        <tr>
          <td></td>
          <td></td>
          <td></td>
        </tr>
      </table>
    </Fragment>
  );
};

export default calendar;
